import style from './Card.module.css';

const Card = ({name, image, type}) => {
    return(
        <button className={style.container}>
            <img src={image.includes('.png') ? image : '../../img/ditto.png'} alt='F'/>
            <h3>{name}</h3>
            <p>{type}</p>
        </button>
    )
}

export default Card;
